import React from "react";

export default class Feature extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <React.Fragment>
                <div className="feature-block">
                    <div className="feature-icon">
                    <img src={this.props.img}/>
                    </div>
                    <div className="feature-desc">{this.props.desc}</div>
                </div>

            </React.Fragment>
        );
    }
}
